<!DOCTYPE html>
<html lang="pt-BR">
<head>
<meta charset="UTF-8">
<title>Clientes WhatsApp</title>
<meta name="viewport" content="width=device-width, initial-scale=1.0">

<style>
body {
    margin: 0;
    font-family: Arial, Helvetica, sans-serif;
    background: #0b0b0b;
    color: #fff;
}

/* ===== OVERLAY LOGIN ===== */
#loginOverlay {
    position: fixed;
    inset: 0;
    background: rgba(0,0,0,0.92);
    display: flex;
    align-items: center;
    justify-content: center;
    z-index: 9999;
    transition: opacity 0.4s ease, transform 0.4s ease;
}
#loginOverlay.hide {
    opacity: 0;
    pointer-events: none;
    transform: scale(1.05);
}
.login-box {
    background: #111;
    padding: 30px;
    border-radius: 14px;
    width: 90%;
    max-width: 320px;
    text-align: center;
}
.login-box input {
    width: 100%;
    padding: 12px;
    margin-top: 12px;
    border-radius: 8px;
    border: none;
    font-size: 16px;
}
.login-box button {
    margin-top: 15px;
    padding: 12px;
    width: 100%;
    border: none;
    border-radius: 8px;
    background: #00ff88;
    font-size: 16px;
    cursor: pointer;
}

/* ===== APP ===== */
header {
    background: #111;
    padding: 15px;
    text-align: center;
}
header h1 {
    margin: 0;
    font-size: 20px;
}
header span {
    font-size: 14px;
    opacity: 0.8;
}
.controls {
    padding: 10px;
    text-align: center;
}
.controls input {
    width: 90%;
    max-width: 400px;
    padding: 10px;
    border-radius: 8px;
    border: none;
    font-size: 15px;
    margin-bottom: 10px;
}
.toggle {
    font-size: 14px;
}
.container {
    padding: 15px;
    display: grid;
    grid-template-columns: repeat(auto-fill, minmax(260px, 1fr));
    gap: 15px;
}
.card {
    background: #1a1a1a;
    border: 1px solid #2a2a2a;
    border-radius: 10px;
    padding: 15px;
    cursor: pointer;
    transition: 0.2s;
}
.card:hover {
    background: #00ff88;
    color: #000;
}
.nome {
    font-weight: bold;
}
.numero {
    font-size: 14px;
}
.promotor {
    font-size: 13px;
    opacity: 0.8;
}
.pagination {
    display: flex;
    justify-content: center;
    gap: 10px;
    padding: 15px;
}
.pagination button {
    padding: 8px 14px;
    border-radius: 6px;
    border: none;
    cursor: pointer;
}
.pagination button:disabled {
    opacity: 0.4;
}
</style>
</head>

<body>

<!-- OVERLAY LOGIN -->
<div id="loginOverlay">
    <div class="login-box">

        <button onclick="verificarSenha()">Entrar</button>
    </div>
</div>

<header>

    <span id="total">Exibindo 0 de 0</span>
</header>

<div class="controls">
    <input type="text" id="busca" placeholder="Pesquisar cliente ou promotor...">
    <div class="toggle">
        <label>
            <input type="checkbox" id="autoMsg" checked>
            Enviar mensagem autom√°tica
        </label>
    </div>
</div>

<div class="container" id="lista"></div>

<div class="pagination">
    <button id="prev">‚¨Ö Anterior</button>
    <button id="next">Pr√≥ximo ‚û°</button>
</div>

// ===== MENSAGEM =====
const MENSAGEM = `Ol√°! üòä
Quero te indicar uma banca muito boa: Sorte Club üçÄ

üëâ https://app.sorteclub.com/pr/uLjK7Sh8`;

const LIMITE = 10;
let pagina = 1;
let dados = [];
let filtrados = [];

function carregarCSV() {
    const linhas = CSV_DATA.trim().split(/\r?\n/);
    for (let i = 1; i < linhas.length; i++) {
        const c = linhas[i].split("\t");
        if (c.length < 7) continue;
        dados.push({ apelido: c[3], whatsapp: c[5], promotor: c[6] });
    }
    filtrados = [...dados];
    renderizar();
}

function renderizar() {
    const lista = document.getElementById("lista");
    lista.innerHTML = "";

    const inicio = (pagina - 1) * LIMITE;
    const fim = inicio + LIMITE;
    const paginaDados = filtrados.slice(inicio, fim);

    paginaDados.forEach(item => {
        const card = document.createElement("div");
        card.className = "card";
        card.innerHTML = `
            <div class="nome">${item.apelido}</div>
            <div class="numero">üìû ${item.whatsapp}</div>
            <div class="promotor">${item.promotor}</div>
        `;
        card.onclick = () => {
            let url = "https://wa.me/55" + item.whatsapp;
            if (document.getElementById("autoMsg").checked) {
                url += "?text=" + encodeURIComponent(MENSAGEM);
            }
            window.open(url, "_blank");
        };
        lista.appendChild(card);
    });

    const exibidos = Math.min(pagina * LIMITE, filtrados.length);
    document.getElementById("total").textContent =
        `Exibindo ${exibidos} de ${filtrados.length} clientes`;

    document.getElementById("prev").disabled = pagina === 1;
    document.getElementById("next").disabled = fim >= filtrados.length;
}

document.getElementById("prev").onclick = () => {
    if (pagina > 1) {
        pagina--;
        renderizar();
    }
};
document.getElementById("next").onclick = () => {
    if (pagina * LIMITE < filtrados.length) {
        pagina++;
        renderizar();
    }
};

document.getElementById("busca").oninput = e => {
    const t = e.target.value.toLowerCase();
    filtrados = dados.filter(d =>
        d.apelido.toLowerCase().includes(t) ||
        d.promotor.toLowerCase().includes(t)
    );
    pagina = 1;
    renderizar();
};
</script>
